import React, { useEffect, useState } from 'react';
import homeImg from "../Assets/Image1.jpg";
import weddingImg from "../Assets/Image3.jpg";
import bollywoodNightImg from "../Assets/Image2.jpg";
import clubsBarsImg from "../Assets/Image4.jpg";
import "../CSS/homeComponent.css";
import { GoogleCalendarAPI } from 'react-google-calendar-api';

const HomeComponent = () => {
    const [events, setEvents] = useState([]);
    const [loading, setLoading] = useState(true);
    const [email, setEmail] = useState('');

  useEffect(() => {
    const loadCalendarEvents = async () => {
      try {
        const calendar = new GoogleCalendarAPI("AIzaSyArkRwfokzN3fOxiCvr7sBQNOPeRcHlUXI");
        const calendarId = `shubhcy99@gmail.com`;

        // Initialize the Google Calendar API with your API Key
        calendar.loadCalendarEvents(calendarId, callbackFunction);
        // Fetch upcoming events
        const response = await calendar.getUpcomingEvents();
        console.log(response);

        setEvents(response.result.items);
        setLoading(false);
      } catch (error) {
        console.error('Error loading upcoming events:', error);
        setLoading(false);
      }
    };

    loadCalendarEvents();
  }, []);

  const callbackFunction = (events) => {
    // Handle the loaded events here
    console.log('Loaded events:', events);
  };

  const handleEmailChange = (e) => {
    setEmail(e.target.value);
  };

  const handleFormSubmit = (e) => {
    e.preventDefault();
    // Implement your logic to subscribe the email
    console.log('Subscribed email:', email);
    // Reset the form
    setEmail('');
  };


  return (
    <>
    <div className="homeimg">
      <div className="left-column">
        <img src = {homeImg} alt = "Home"/>
      </div>
      <div className="right-column">
        <div className="content">
          <h2>Adaaah</h2>
          <p>Bollywood DJ | Entertainment | Design</p>
        </div>
      </div>
    </div>

    <div className="dj-services">
        <h2 className="heading">DJ Services</h2>
        <div className="column">
            <div className="circle">
                <img src = {weddingImg} alt="Wedding" />
            </div>
                <h3 className = "dj-heading3">Wedding</h3>
                <p className = "dj-p">LOur wedding DJs are masters of creating unforgettable moments. With their curated music, seamless transitions, and engaging crowd interactions, they set the stage for an extraordinary celebration. From the grand entrance to the last dance, our DJs curate the perfect playlist that reflects the couple's unique style and keeps the energy alive throughout the night. Their expertise in reading the crowd ensures that every guest has a memorable experience on the dance floor. Trust our wedding DJs to bring the joy and excitement that will make your special day truly remarkable.</p>
        </div>
        <div className="column">
            <div className="circle">
                <img src = {bollywoodNightImg} alt="Bollywood Night" />
            </div>
                <h3 className = "dj-heading3">Bollywood Night</h3>
                <p className = "dj-p">Our Bollywood night DJs are experts in creating an electrifying atmosphere filled with the vibrant beats and rhythms of Bollywood music. With their deep knowledge of Bollywood tracks, seamless mixing skills, and crowd-pleasing interactions, they bring the energy and excitement of a Bollywood party to life. From the latest chart-toppers to classic favorites, our DJs curate a playlist that will have everyone on their feet, dancing the night away. Whether it's a wedding, corporate event, or private party, our Bollywood night DJs ensure an unforgettable experience where guests can immerse themselves in the magic of Bollywood music and create memories that last a lifetime.</p>
        </div>
        <div className="column">
            <div className="circle">
                <img src = {clubsBarsImg} alt="Clubs and Bars" />
            </div>
                <h3 className = "dj-heading3">Clubs and Bars</h3>
                <p className = "dj-p">Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
            </div>
        </div>

        <div className="upcoming-events">
            <h2>Upcoming Events</h2>
            {loading ? (
                <p>Loading...</p>
            ) : events.length > 0 ? (
                <ul>
                {events.map((event) => (
                    <li key={event.id}>
                    <div>{event.summary}</div>
                    <div>{event.start.dateTime || event.start.date}</div>
                    </li>
                ))}
                </ul>
            ) : (
                <p>No upcoming events</p>
            )}
        </div>

        <div className="subscribe-container">
            <h2>Subscribe to Get Notifications</h2>
            <p>Sign up to be the first to know about Bollywood DJ nights and other events hosted by Adaaah</p>
            <form className = "subscribe-form" onSubmit={handleFormSubmit}>
                <input className = 'subscribe-input'
                type="email"
                placeholder="Enter your email"
                value={email}
                onChange={handleEmailChange}
                />
                <button className = "subscribe-btn" type="submit">Subscribe</button>
            </form>
        </div>
    </>
  );
};


export default HomeComponent;
